import React from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import './index.css';
import Header from './component/GoogleKeep/Header';
import Footer from './component/GoogleKeep/Footer';
import Note from './component/GoogleKeep/Note';

const App = ()=>{
    return (
        <>
            <Header/>

            <Note/>

            <div style={{display:'block',justifyContent:'center'}}>

            <div class="card" style={{width:'18rem',marginTop:'10px'}}>
                
                <div class="card-body">
                    <h5 class="card-title"><input placeholder="title"/></h5>
                    <textarea placeholder="Write Note..." style={{width:'100%'}}></textarea>
                    <a  href="#" class="btn btn-primary">+</a>
                </div>
            </div>


            <div className="AllData">
                
            <div class="card" style={{width:'18rem',marginTop:'10px'}}>
                
                <div class="card-body">
                    <h5 class="card-title">Title</h5>
                    <p>Note...</p>
                    
                </div>
            </div>

            </div>
            
            </div>

            
            

            
            <Footer/>
        </>
    )
}

export default App;
